import appData from "../../api/appData";

import {FETCH_USERS} from "../action-types";


export const fetchUsers =() =>async dispatch=>{
    const response = await appData.get(`/users`);
    console.log(response.data)
    dispatch({
        type:FETCH_USERS,
        payload:response.data
    })
};
